--
-- Name: get_mutual_information(text); Type: FUNCTION; Schema: public; Owner: akennedy
--

CREATE FUNCTION get_mutual_information(sql text) RETURNS TABLE(column1 text, column2 text, mi numeric, total numeric)
    LANGUAGE plpgsql
    AS $_$
DECLARE
column1 text;
column2 text;
func_cmd text;
records record; 
curs2 SCROLL CURSOR FOR
WITH TEMP1 AS (SELECT regexp_replace(regexp_replace(regexp_split_to_table(regexp_replace(sql,'SELECT(.*)FROM.*','\1'),','),'.* AS ',''),'[ \n]','') COL)
SELECT DISTINCT least(t1.COL,t2.COL) COL1, greatest(t1.COL,t2.COL) COL2 FROM TEMP1 t1 JOIN TEMP1 t2 ON t1.COL != t2.COL;
BEGIN

	func_cmd := 'WITH TEMP2 AS ('||sql||')';

	FOR r IN curs2 LOOP
		func_cmd := func_cmd||'SELECT '''||r.col1||'''::text COLUMN1, '''||r.col2||'''::text COLUMN2, SUM(PXY * log(2.0,PXY/(PX*PY)))::numeric MI
		,SUM(PXY) TOTAL 
		FROM(SELECT 1.0*FX/N PX,1.0*FY/N PY,1.0*FXY/N PXY
			FROM(SELECT COUNT(1) N FROM TEMP2) s
			JOIN(SELECT DISTINCT t.'||r.col1||', t.'||r.col2||', FX, FY, FXY
				FROM TEMP2 t
				JOIN(SELECT COUNT(1)  FX, '||r.col1||'               FROM TEMP2 GROUP BY '||r.col1||'              ) x  ON  x.'||r.col1||' = t.'||r.col1||'
				JOIN(SELECT COUNT(1)  FY, '||r.col2||'               FROM TEMP2 GROUP BY '||r.col2||'              ) y  ON  y.'||r.col2||' = t.'||r.col2||'
				JOIN(SELECT COUNT(1) FXY, '||r.col1||', '||r.col2||' FROM TEMP2 GROUP BY '||r.col1||', '||r.col2||') xy ON xy.'||r.col1||' = t.'||r.col1||' AND xy.'||r.col2||' = t.'||r.col2||'
				WHERE 1=1
				) s1 ON 1=1
			WHERE 1=1
			) s2
		WHERE 1=1 UNION ALL
		';
	END LOOP;
	func_cmd := regexp_replace(func_cmd,'UNION ALL\n[ \t]*$','');

 	RAISE INFO '%', func_cmd; 
	RETURN QUERY EXECUTE 'SELECT * FROM (' || func_cmd ||') AS records;';
END;
$_$;


